import React, { Component } from 'react';
import './desktop.css';
import logo_fondo from '../../images/logo_fondo.png?v1.0';

class WelcomePage extends Component {	
  	render() {
  	  	return (
  	  		<div className="WelcomeFondo" style={{backgroundImage: 'url(${logo_fondo})', backgroundPosition: 'center', backgroundRepeat: 'no-repeat'}}>  	  					  
  	  			
  	  		</div>		    		
	    );
  	}
}

export default WelcomePage
